import React from "react";

function OverView() {
  return (
    <div class="container border rounded row" style={{ width: "800px", height: "100px" }}>
      <th>What you'll learn</th>
      <div class="row">
        <div class="col-6"> Create their own Python Programs </div>
        <div class="col-6"> Become an experienced Python Programmer</div>
        <div class="col-6"> Parse the Web and Create their own Games</div>
      </div>
    </div>
  );
}

export default OverView;
